import React from "react";
import { Card, Col, Container, Row } from "react-bootstrap";
import Strategy from "../assets/images/FLRSH_What_We_Do_Strategy.svg";
import Creative from "../assets/images/FLRSH_What_We_Do_Creative.svg";
import Technology from "../assets/images/FLRSH_What_We_Do_Tech.svg";
import Marketing from "../assets/images/FLRSH_What_We_Do_Marketing.svg";

export default function Whatwedo() {
  return (
    <section className="position-relative py-5 mt-5">
      <small
        className="artboard-text position-absolute text-uppercase top-50 fw-bold d-none d-lg-block"
        style={{
          left: "0px",
          color: "#ff6442",
          letterSpacing: "5px",
          transform: "rotate(-90deg)",
        }}
      >
        What We Do
      </small>
      <Container>
        <Row className="gx-lg-5">
          {whatWeDoContents.map((content, i) => (
            <Col lg={3} md={6} className="mt-4 mt-lg-0" key={i}>
              <Card className="border-0">
                <Card.Img
                  variant="top"
                  src={content.image}
                  alt={content.title}
                  className="border-0 p-0 bg-white image-fluid"
                ></Card.Img>
                <Card.Body className="px-0">
                  <Card.Title>{content.title}</Card.Title>
                  <Card.Text className="description">
                    {content.description}
                  </Card.Text>
                  <Card.Link
                    href={content.link}
                    className="align-items-center float-end mt-4"
                  >
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      width="16"
                      height="16"
                      fill="currentColor"
                      className="bi bi-arrow-up-right"
                      viewBox="0 0 16 16"
                    >
                      <path
                        fillRule="evenodd"
                        d="M14 2.5a.5.5 0 0 0-.5-.5h-6a.5.5 0 0 0 0 1h4.793L2.146 13.146a.5.5 0 0 0 .708.708L13 3.707V8.5a.5.5 0 0 0 1 0v-6z"
                      />
                    </svg>
                    <span className="ms-1">read more...</span>
                  </Card.Link>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>
      </Container>
    </section>
  );
}

const whatWeDoContents = [
  {
    image: Strategy,
    title: "Strategy",
    description:
      "Lorem ipsum dolor sit amet consectetur adipisicing elit. Officiis quaerat dolorem ex aliquid non cumque similique nihil amet provident pariatur!",
    link: "/",
  },
  {
    image: Creative,
    title: "Creative",
    description:
      "Lorem ipsum dolor sit amet consectetur adipisicing elit. Officiis quaerat dolorem ex aliquid non cumque similique nihil amet provident pariatur!",
    link: "/",
  },
  {
    image: Technology,
    title: "Technology",
    description:
      "Lorem ipsum dolor sit amet consectetur adipisicing elit. Officiis quaerat dolorem ex aliquid non cumque similique nihil amet provident pariatur!",
    link: "/",
  },
  {
    image: Marketing,
    title: "Marketing",
    description:
      "Lorem ipsum dolor sit amet consectetur adipisicing elit. Officiis quaerat dolorem ex aliquid non cumque similique nihil amet provident pariatur!",
    link: "/",
  },
];
